import React from "react";
import styled from "styled-components";

const MainFooterHolder = styled.div`
  width: 100%;
  margin-top: 60px;
`;

const FooterContent = styled.div`
  width: 100%;
  padding: 15px 0;
  max-width: 2000px;
  margin: 0 auto;
  display: flex;
  align-items: flex-start;
  justify-content: space-around;
  border-top: 2px solid #0199b0;
  @media (max-width: 750px) {
    flex-wrap: wrap;
    max-width: 1000px;
    background: blue;
    align-items: center;
    justify-content: center;
  }
`;

const MainColumn = styled.div`
  width: 20%;
  height: 25vh;
  display: flex;
  flex-direction: column;
  margin: 0 auto;
  align-items: flex-start;
  justify-content: center;
  ul{
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    a{
      color: #282828;
      margin: 5px 0;
    }
    a1{
      color: purple;
      margin: 5px 0;
    }
  }
  @media (max-width: 750px) {
    display: none;
  }
`;
const MainColumnMobile = styled.div`
  display: none;
  @media (max-width: 750px) {
    display: flex;
    width: 100%;
    height: 25vh;
    flex-direction: row;
    align-items: center;
    margin: 0 0;
    text-align: center;
    justify-content: center;
    ul{
      display: flex;
      flex-direction: column;
      justify-content: space-between;
      align-items:  center;
      a{
        color: #282828;
        margin: 5px 0;
      }
      a1{
        color: purple;
        margin: 5px 0;
